script: |
  super -f text -I q12051.spq | sort > q12051.out

inputs:
  - name: q12051.spq
    data: |
      SELECT DISTINCT col0 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( - col0 * - - 3 + + CAST ( NULL AS INTEGER ) * 72 ) NOT IN ( - 90 + - 1 * col2 );
  - name: tab1

outputs:
  - name: q12051.out
    data: |
